import React from 'react'
import Courses from './Courses';
import { Dummydata } from './Dummydata'
const CourseList = () => {
    
    console.log(Dummydata,"jhsgdhwsv"); 
  return (
    <><h1>hi</h1>
        { 
        Dummydata.map((ele)=>{       
                return (<Courses
                    key={ele.id} 
                    id={ele.id}
                     title={ele.title}
                    description={ele.description}
                    price={ele.price}
                    img={ele.img}
                />)
        })
        }
      
    </>
  )
}

export default CourseList
